window.bookSummaryJSON = "<p><b>Trust a demon from Hell, and you're guaranteed to get burned.</b> </p> <p>After failing to gain all her powers, Jade Blackwell is now on a mission to find a new way to Ascend before the apocalypse begins. When she discovers the reason she's been grounded is because of the greed demon Monnie and a deal she made with him unknowingly, she must do all she can to free herself from their contract. And do it before the demon finds her and drags her to Hell for all of eternity.</p> <p>Since Jade has no plans to lose her soul anytime soon, she must avoid Monnie's halflings at all costs. But when her escape brings her in the line of fire of three warring vampire clans, she is faced with a new and very real danger. One that involves a particular old acquaintance and club owner named Andre DeMonte and is about to spill over into all of Fairport.</p> <p>With time ticking down, tensions run high as the darkness descends. It will take everything for Jade to climb her way out of the chaos and rise to her full potential. </p> <p><b>The entire fate of the world depends on it.</b> </p> <p>Fans of the Riley Jenson Guardian Series and Supernatural cannot stop listening to the Reaper Reborn Series! </p> <p><b>With dry humor, realistic drama, and pause-resisting tension, you'll get addicted as you add it to your collection. Scroll up and one-click it today!</b> </p>"; 
